import React from 'react';
import { Link } from 'react-router-dom';
import PhotographySlider from '../components/PhotographySlider';
import CategoryCarousel from '../components/CategoryCarousel';
import { 
  weddingImages, 
  eventImages, 
  birthdayImages, 
  portraitImages, 
  natureImages 
} from '../data/images';

const Home = () => {
  return (
    <div>
      <section className="hero">
        <div className="hero-content">
          <h1>Capturing Life's Beautiful Moments</h1>
          <p>
            Professional photography services for weddings, events, birthdays, portraits, and nature. 
            Let us help you preserve your precious memories with stunning imagery.
          </p>
        </div>
      </section>

      {/* Photography Section with Slider */}
      <section className="photography-section">
        <div className="container">
          <h2 className="section-title">Photography</h2>
          <PhotographySlider />
        </div>
      </section>

      {/* Category Carousels Section */}
      <section className="categories-section">
        <div className="container">
          <h2 className="section-title">Our Photography Services</h2>

          {/* Wedding Photography */}
          <div className="category-section">
            <CategoryCarousel 
              title="Wedding Photography"
              images={weddingImages}
              category="wedding"
            />
          </div>

          {/* Event Photography */}
          <div className="category-section">
            <CategoryCarousel 
              title="Event Photography"
              images={eventImages}
              category="event"
            />
          </div>

          {/* Birthday Photography */}
          <div className="category-section">
            <CategoryCarousel 
              title="Birthday Photography"
              images={birthdayImages}
              category="birthday"
            />
          </div>

          {/* Portrait Photography */}
          <div className="category-section">
            <CategoryCarousel 
              title="Portrait Photography"
              images={portraitImages}
              category="portrait"
            />
          </div>

          {/* Nature Photography */}
          <div className="category-section">
            <CategoryCarousel 
              title="Nature Photography"
              images={natureImages}
              category="nature"
            />
          </div>
        </div>
      </section>
    </div>
  );
};

export default Home;
